import React from "react";

const Level = () => {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      10
      <svg
        width="50"
        height="50"
        viewBox="0 0 200 200"
        fill="none"
        stroke="black"
        strokeWidth="5px"
      >
        <circle
          class="outer"
          cx="95"
          cy="95"
          r="85"
          transform="rotate(-90, 95, 95)"
        />
      </svg>
    </div>
  );
};

export default Level;
